import '../Stylings/Calendar.css';
import {ArrowBackIosNewIcon, ArrowForwardIosIcon} from '@mui/icons-material';

export function Calendar() {
    return (
        <div className="calendarContainer">
            <div className="calendarHeader"> 
                <h1>July 2023</h1>
                <ArrowBackIosNewIcon />
                <ArrowForwardIosIcon />
            </div>

        </div>
    );
}
